INSERT INTO `features` VALUES (1,'DIGITAL INVERTER TECHNOLOGY	','f80be268c747e5637ffe31650d8f79a3.jpg','image/jpeg',24009,'2015-10-16 08:46:00','Savings up to 60% Electricity compared to conventional models.	','','DIGITAL INVERTER TECHNOLOGY which gives energy savings up to 60% vs conventional models. Unlike Regular ACs, digital Inverter models doesnt shuts on and off the compresor and thus maintains the set temperature by adjusting its fan speed. A compressor with inverter technology works very much like a car accelerator. When the speed required is more, the acceleration is more, and when it is less, and then the acceleration is less. This makes sure that during summer months when cooling load is more, the compressor works at peak capacity taking more electricity. But during winter months when cooling load is less, the compressor works less there by consuming less electricity. Even in summer month, the night temperature is less than the day temperature and thus electricity savings happen in night when compressor can run at a lesser speed. This kind of compressor never switches off even when the temperature stabilizes, but runs at a slower speed maintaining the temperature inside the refrigerator. The benefits are: In an on off cycle of a regular refrigerator, inside temperature varies throughout. But in case of inverter technology, temperature is more stable. The amount of noise made by the refrigerator is much less in refrigerators with inverter technology as compared to the regular ones. Energy or electricity consumption is much less when the temperature stabilizes.	',1,NULL,'2015-09-08 12:20:24','2015-10-16 08:46:01');
/*!40000 ALTER TABLE `features` ENABLE KEYS */;
UNLOCK TABLES;

