INSERT INTO `products` VALUES (1,1,'AR12JV5HATQNNA','New Boracay Split AC with Digital Inverter Technology, 1.0 TR',44400,41000,'','Digital Inverter Technology - Multijet Plus Technology - Single user mode',NULL,1,1,NULL,1,'Ton','#fcfffc','NSNKNS',10,'2015-09-08 12:46:05','2015-10-16 00:31:45',0,'Digital Inverter Technology - Multijet Plus Technology - Single user mode','09ce0294-ae2e-11e5-82d8-f23c916e290f'),(2,3,'','Bodycon Midi Dress',NULL,NULL,'','Bodycon Midi Dress features a zip back closure and a sleek silhouette that shows off your fabulous curves.Add a red lip and loose tresses.',NULL,1,0,NULL,NULL,'','#ffffff','',NULL,'2015-10-19 12:59:47','2015-10-19 12:59:47',0,'Bodycon Midi Dress features a zip back closure and a sleek silhouette that shows off your fabulous curves.Add a red lip and loose tresses.','09ce0546-ae2e-11e5-82d8-f23c916e290f'),(3,3,'','Floral Jacquard Pleat Dress',NULL,NULL,'','Super-pretty flared  dress in a fun tweedy-floral jacquard, designed to get you noticed.  ',NULL,1,0,NULL,NULL,'','#808080','',NULL,'2015-10-19 13:11:05','2015-10-19 13:11:05',0,'Super-pretty flared  dress in a fun tweedy-floral jacquard, designed to get you noticed.  ','09ce065e-ae2e-11e5-82d8-f23c916e290f'),(4,3,'','Miranda Bandage Dress',NULL,NULL,'','Fearless bandage dress  heating things up with edgy-sexy cage yokes and precision overlay  banding that showcases curves. Cutaway armholes spotlight shoulders. ',NULL,1,0,NULL,NULL,'','#ff0000','',NULL,'2015-10-19 13:15:59','2015-10-19 13:15:59',0,'Fearless bandage dress  heating things up with edgy-sexy cage yokes and precision overlay  banding that showcases curves. Cutaway armholes spotlight shoulders. ','09ce0744-ae2e-11e5-82d8-f23c916e290f'),(5,3,'','Lace Back Cutout Gown',NULL,NULL,'','Stunning gown in an  elegant georgette, flaunting a gorgeous 2-piece look with front-to-back  waist cutout detail.',NULL,1,0,NULL,NULL,'','#ff0000','',NULL,'2015-10-19 13:17:26','2015-10-19 13:17:26',0,'Stunning gown in an  elegant georgette, flaunting a gorgeous 2-piece look with front-to-back  waist cutout detail.','09ce0a64-ae2e-11e5-82d8-f23c916e290f'),(6,3,'','Petite Strapless Dress',NULL,NULL,'','Ultra-desirable  strapless bandage dress stealing the scene with a curve-capturing  sweetheart bodice.',NULL,1,0,NULL,NULL,'','#800040','',NULL,'2015-10-19 13:20:06','2015-10-19 13:20:06',0,'Ultra-desirable  strapless bandage dress stealing the scene with a curve-capturing  sweetheart bodice.','09ce0b5e-ae2e-11e5-82d8-f23c916e290f'),(7,3,'','Print Fit & Flare Dress',NULL,NULL,'','Magical fit-and-flare  dress in sumptuous jacquard detailed by a richly hued placed print.  Gathered skirt with full undernetting adds fabulous volume.',NULL,1,0,NULL,NULL,'','#000000','',NULL,'2015-10-19 13:22:01','2015-10-19 13:22:01',0,'Magical fit-and-flare  dress in sumptuous jacquard detailed by a richly hued placed print.  Gathered skirt with full undernetting adds fabulous volume.','09ce0c30-ae2e-11e5-82d8-f23c916e290f'),(8,3,'','Petite Lace Cutout Gown',NULL,NULL,'','Stunning gown in an  elegant georgette, flaunting a gorgeous 2-piece look with front-to-back  waist cutout detail. Chic back lace bodice and sweeping skirt elevates the look. ',NULL,0,0,NULL,NULL,'','#000000','',NULL,'2015-10-19 13:23:34','2015-10-19 13:23:34',0,'Stunning gown in an  elegant georgette, flaunting a gorgeous 2-piece look with front-to-back  waist cutout detail. Chic back lace bodice and sweeping skirt elevates the look. ','09ce0d0c-ae2e-11e5-82d8-f23c916e290f'),(9,3,'','Print Eyelash Lace Hem Top',NULL,NULL,'','Beautiful crepe top in a  right-now boxy cut and bold oversized print. Eyelash lace hem band and  softly gathered sleeves.',NULL,0,0,NULL,NULL,'','#000000','',NULL,'2015-10-19 13:25:31','2015-10-19 13:25:31',0,'Beautiful crepe top in a  right-now boxy cut and bold oversized print. Eyelash lace hem band and  softly gathered sleeves.','09ce0de8-ae2e-11e5-82d8-f23c916e290f'),(10,3,'','3/4 Sleeve Wrap Crop Top',NULL,NULL,'','Wrap