c look 100% cotton. Made in China. Machine Wash Cold (30C), Wash Separately, Remove Immediately, Do Not Bleach, Line dry, Warm iron, Do Not Dry Clean.\r\n','937376d6-6c57-4d63-83f0-7a23114543c8'),(671,176,NULL,'Mens Double Needle Work Shirt',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 08:00:01','2016-01-02 08:00:01',0,'The Converse All Star Mens Double Needle Work Shirt looks great as a work shirt with a classic fit. Its chambray construction is treated with an enzyme wash for a softer and more comfortable feel. 100% cotton. Made in China. Machine Wash Cold (30C) with like colors. Use non-chlorine bleach if needed. Tumble dry low. Warm iron. Do not dry clean.\r\n','66fcd2db-f242-4118-a974-1a43e54f0008'),(672,176,NULL,'Mens CONS fleece pullover sweatshirt',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 08:11:06','2016-01-02 08:11:06',0,'The Converse CONS pullover sweatshirt is a classic look with some modern updates. Its made with our signature double weave thermal fleece with rib side panels for breathability and mobility, with an on seam pocket, a CONS signature cell phone pocket with elastic binding, and a stash pocket with zip closure. Its suitable for breaking the world record of your choice, or just hanging out with your crew. Made in China. Machine wash cold. Wash with like colors. Use non-chlorine bleach if needed. Tumble dry low. Warm Iron. Do not dry clean.\r\n','aca2e6bd-30e8-4ec7-8936-21569db9e890'),(673,176,NULL,'Mens MA-1 Zip Thru Hoodie',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 08:15:26','2016-01-02 08:15:26',0,'The Converse All Star Mens MA-1 Zip Thru Hoodie offers something out of the ordinary while delivering all the benefits you demand, like softness, warmth and multiple pockets. Constructed of loopback tricot and interior French terry fabric in orange for a tinted affect. The classic MA-1 style pocket adds an authentic look. The rubberized black Chuck patch delivers a classic detail. 55% Cotton, 45% Polyester. Made in China. Machine Wash Cold(30C), Wash With Like Colors, Do Not Bleach, Tumble Dry Low, Warm Iron, Do Not Dry Clean\r\n','5c628f5e-6e56-4656-901d-3c4649064f43'),(674,176,NULL,'CONS Waffle Coaches Fleece',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 08:37:30','2016-01-02 08:37:30',0,'In the late 80s and early 90s, skaters found a love for sportswear and adopted the coachs jacket into their culture. Light and roomy enough for complete freedom of motion, its turned into an essential item. The Mens CONS Coaches Waffle Fleece Jacket is crafted with a textured double knit fabric with a waffle knit on the interior for warmth and durability, concealed pockets with forward facing side seam, double folded heavyweight rib cuff, classic draw cord with metal tips and is secured with snaps. Made in China. Machine Wash Cold (30C), wash with like colors. Do not bleach. Tumble dry low. Warm iron. Do not iron print design. Do not dry clean.\r\n','68495f07-3c0c-4e1e-b4d9-c3cab5ef487a'),(675,176,NULL,'Mens CONS Star Chevron Crew Fleece',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 08:45:01','2016-01-02 08:45:01',0,'As summer recedes into fall, evenings can get a little chilly. The Mens CONS Star Chevron Crew Fleece is a mid-weight long sleeve sweatshirt thats a comfy fleece blend in a classic cut that will keep you warm whether youre roasting marshmallows around the campfire or out for a ride on your beach cruiser. Made in China. Machine wash cold. Wash with like colors. Do not bleach. Tumble dry low. Warm Iron. Do not iron print design. Do not dry clean.\r\n','dc223d4e-f11f-4938-99a2-51a58e026bb6'),(676,176,NULL,'Mens Black Wash Popover Hoodie',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 08:52:38','2016-01-02 08:52:38',0,'The Converse All Star Mens Black Wash Popover Hoodie. Its the thing you grab in the morning when the world looks cool and gray. Constructed of transitional French terry for comfort, it has been Black Pigment washed for a faded color look and a bottom shirttail hem. 100% cotton. Made in China. Machine Wash Cold (30C) with like colors. Use non-chlorine bleach if needed. Tumble dry low. Warm iron. Do not dry clean.\r\n','e44fc5da-ea35-4919-8baf-2372c64eab65'),(677,176,NULL,'Mens Black Wash Pants',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 09:23:33','2016-01-02 09:23:33',0,'Faded pants like the Converse All Star Mens Black Wash Pant look already broken in and experienced. They project a life lived, and with the French Terry construction, a comfortable one at that. 100% cotton. Made in China. Machine Wash Cold (30C) with like colors. Use non-chlorine bleach if needed. Tumble dry low. Warm iron. Do not dry clean.\r\n','72cbcfd2-9d25-49c4-96b9-2b2ca025adbf'),(678,176,NULL,'Mens Rib Cuff Pants',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 09:28:55','2016-01-02 09:28:55',0,'Meet the elevated sweat pant. The Converse All Star Mens Core Plus Cuff Pant is constructed of yarn dye French Terry for lightweight comfort and a heathered look. It has contrasting ribs at the pockets and bottom cuffs. 100% cotton. Made in China. Machine Wash Cold (30C) with like colors. Use non-chlorine bleach if needed. Tumble dry low. Warm iron. Do not dry clean.\r\n','5b5fb5c9-f377-4a27-aee4-32741ff677f7'),(679,176,NULL,'Mens CONS Cuff Fleece Pants',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-02 09:31:28','2016-01-02 09:31:28',0,'Dont blame us if you find the Converse CONS Core Cuff Pants so comfortable you dont ever want to take them off, but remember youve got to wear something when you do your laundry (or just get two pairs). Theyre comfortable fleece with a slight drop in the front and a slight rise in the back, with our signature double bar tacks, a front we