s so adorably dropped with spiky motifs making it more mesmerizing. It is made of alloy with sparkling silver tone. Get it today!\r\n','16861f0d-0cef-46e7-aa86-5d70dc5c3e4a'),(730,200,NULL,'COOL & CHIC PRETTY TURQUOISE BEADED SHORT NECKLACE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 08:39:26','2016-01-17 08:39:26',0,'Cool and chic, this short necklace is perfect for a brunch with the girls or a day out with family. This collection is perfect for all your daily jewellery needs and it gets distinct with party outfits!\r\n','5593cd79-6499-41dc-b4f8-1eb9e3107565'),(731,200,NULL,'BIB NECKLACE DECORATED WITH DAINTY GOLDEN BEADS; CHAIN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 08:41:42','2016-01-17 08:41:42',0,'It is an exquisite piece of fashion jewellery that enhances appearance and makes a modern statement. Featuring bib design decorated with dainty golden beads and chain it is for all that a woman has become and all that she wants to be.\r\n','c721267e-03b8-47b4-8996-4fb0b2557889'),(732,7,NULL,'MISA SLEEVELESS SINGLE ZIP SHIRT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 09:28:04','2016-01-17 09:28:04',0,'Keep your weekend wardrobe casually chic with this sleeveless single zip denim shirt in midwash. Designed to be relaxed in silhouette, this collared style features a centre front placket with silver snaps, front functional pocket with zip detail, cruved hem and a centre back pleat giving the style a beautiful drape. Wear this blue style with porcelain jeans and sandals for fashionable daytime style.\r\n','c3603972-0db2-4f11-aa5b-18c4fa73b831'),(733,7,NULL,'MAYLENE STUD POCKET SHIRT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 09:28:54','2016-01-17 09:28:54',0,'The epitome of casual; this versatile breathable denim shirt in bleach wash is a timeless casual piece, perfect for the weekend wardrobe. This collared style features shiny silver poppers on the centre front placket, front pockets and roll sleeve tab for adjustable sleeve length. A centre back pleat completes this curved hem style. Wear this pale blue style with jeans and heels for day to night off duty style.\r\n','fdee5437-0eaa-4043-8cc7-f5c76ae9a252'),(734,7,NULL,'KIARA BOX PLEATED POCKET SHIRT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 09:29:58','2016-01-17 09:29:58',0,'This versatile breathable denim shirt in midnight wash is the perfect weekend wardrobe staple. This collared style features a half centre front placket with bronze buttons, two front functional pockets, long cuffed adjustable sleeves with buttoned tab, centre back box pleat giving the garment a beautiful drape and a curved high-low hem. Designed to be relaxed in fit, this dark blue top can be dressed up or down. Pair with pale jeans and sandals for effortless day to night off duty style.\r\n','31ad092e-b2d0-4507-8b21-b397c5022913'),(735,7,NULL,'JAYA SHIRT DRESS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 09:58:50','2016-01-17 09:58:50',0,'Clean and chic design lines define this lightweight denim dress in mid blue wash. This collared shirt dress features two front functional bodice pockets, centre front placket with snap closure, side seam pockets and a removable self-tie belt finished with silver hardware. This slightly oversized knee length style can be worn straight or waisted with the belt for a more feminine silhouette. Dress up with heels or dress down with gladiator sandals for a casually refined day look.\r\n','e1755128-4ce2-442e-9708-f0c19d75d71b'),(736,7,NULL,'CAMILLE SHIRT DRESS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 09:59:42','2016-01-17 09:59:42',0,'Redefine your weekend style with this denim shirt dress in mid blue wash. Fabricated from a lightweight drapey denim, this collared style features a short front placket with buttons, front bodice functional pockets, short adjustable sleeves with buttoned tab, round hem and side seam pockets. This casually chic style is designed to be relaxed in silhouette. Pair with wedges and a fringed bag for on trend day to night style.\r\n','c3e8b37f-7e67-48ae-98f2-da3ac0acef38'),(737,7,NULL,'MAYLENE STUD POCKET SHIRT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 10:01:15','2016-01-17 10:01:15',0,'The epitome of casual; this versatile breathable denim shirt in mid blue wash is a timeless casual piece, perfect for the weekend wardrobe. This collared style features shiny gold poppers on the centre front placket, front pockets and roll sleeve tab for adjustable sleeve length. A centre back pleat completes this curved hem style. Wear with jeans and heels for day to night off duty style.\r\n','b31c2e0f-3d5d-4e73-814d-f7dc0c9e2943'),(738,7,NULL,'FOREVER NEW Sling Bag',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 10:34:56','2016-01-17 10:34:56',0,'Forever New is a versatile brand that offers apparel and accessories that befit all occasions. Its diverse assortment includes dresses, tops, shorts etc. that focus on silhouettes and vibrant accessories like hair bands, hair clips, earrings and neck pieces that complete your attire. Their clothing lines boasts of calm and pastel hues with modish textures.\r\n','dad85f4f-d0ad-45c3-bcd6-01cf3c4ec01a'),(739,81,NULL,'STEVE MADDEN Curb Chain Strap Sling Bag',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#000000',NULL,NULL,'2016-01-17 10:38:56','2016-01-17 10:38:56',0,'Americas favourite shoe designer is fast becoming Indias favourite too. Steve Madden shoes are fashion forward and glamorous. This seasons highlights are sky-high pumps and wedges in a variety of colours and styles. \r\n','128f204a-0e94-4a17-93a9-b1bde9716b46'),(740,114,NULL,'Calvin Klein womens haircalf sling bag',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#00000