INSERT INTO `tips` VALUES (2,'Trousers','','Trousers are basically an office wear and are popular with corporate women. They are best suited with a formal blouse and shirt. Cropped trousers are suitable for most body types and the best part is you can pair them with anything and everything. For a more glam look, you can pair it up with sheer tops and blouses.',19,'tip1.jpg','image/jpeg',101198,'2015-10-16 09:51:18','','2015-10-16 09:51:19','2015-10-29 13:18:58','fe41db08-ae2d-11e5-82d8-f23c916e290f'),(3,'Sheath Dresses','','Sheath Dresses flatter your figure type. This is almost a staple, works from day to night so go pick a few in black, navy blue, slate grey or maroon.',31,'tip2.jpg','image/jpeg',22312,'2015-10-16 09:53:20','','2015-10-16 09:53:22','2015-10-16 09:59:41','fe41ddec-ae2d-11e5-82d8-f23c916e290f'),(4,'Button-Down shirts','','Button-down shirts are casual but classy. They are made with a woven material and can be dressed down by leaving them untucked, or they can be dressed up by tucking them in with a belt. Button down shirts can be worn with casual or semi-formal pants.',21,'tip3.jpeg','image/jpeg',105500,'2015-10-16 09:54:25','Just In','2015-10-16 09:54:27','2015-10-16 09:59:19','fe41dee6-ae2d-11e5-82d8-f23c916e290f'),(5,'Chinos','','Chinos are NOT the same as khakis although they are commonly mistaken to be. Chinos are made from more synthetic materials, have a slight sheen to them. They are slightly more formal than khakis',7,'tip4.jpg','image/jpeg',186278,'2015-10-16 09:55:56','','2015-10-16 09:55:58','2015-10-16 09:55:58','fe41dfd6-ae2d-11e5-82d8-f23c916e290f'),(7,'Cap-Toe Shoes','','The cap-toe is the dressiest and most popular of all the business shoe styles. It looks best when worn with the more serious suit fabrics and styles. If you get one in brown, wear with navy suit, or an earth-toned suit of olive, brown or tan. Black is fine with all of the serious dark colors of gray and navy but not at all with any of the earth tones. Cordovan is the one color that seems to go with everything except black  and is understood everywhere.',24,'tip6.jpg','image/jpeg',12837,'2015-10-16 09:58:21','','2015-10-16 09:58:22','2015-10-16 09:58:22','fe41e0b2-ae2d-11e5-82d8-f23c916e290f'),(8,'Jeans ','','Most men wear Jeans that are too large or too tight. If you can fit in two fingers comfortably between your hip & waist band, you found the right size. ',22,'14.jpg','image/jpeg',190025,'2015-10-29 13:22:32','','2015-10-29 13:22:34','2015-10-29 13:22:34','fe41e1c0-ae2d-11e5-82d8-f23c916e290f'),(9,'Shirts','','Always tuck formal shirts in. Formal shirt\'s length is longer with almost a straight hemline. Never ever tuck them out. ',21,'82464-211780.jpg','image/jpeg',128910,'2015-10-29 13:36:26','','2015-10-29 13:36:28','2015-10-29 13:36:28','fe41e29c-ae2d-11e5-82d8-f23c916e290f'),(10,'Push up Bra','','Push up bras are focused on creating great cleavage, they often come in demi, balcony or plunge cuts. This bra provides the perfect support for halter tops, strapless dresses, backless outfits and a plunging neckline.',40,'10.jpg','image/jpeg',40759,'2015-10-29 15:43:45','','2015-10-29 15:43:47','2015-12-18 09:05:19','fe41e378-ae2d-11e5-82d8-f23c916e290f'),(11,'Suits for Men ','','No matter what, youre going to need a decent suit at some point. Stick with a classic single-breasted, two-button suit in charcoal gray or navy blue. If youre buying off the rack take the time to have the suit adjusted.',44,'42240-135734.jpg','image/jpeg',100797,'2015-10-31 11:22:01','','2015-10-31 11:22:03','2015-12-18 09:03:00','fe41e45e-ae2d-11e5-82d8-f23c916e290f'),(12,'T Shirts ','','Wearing T-shirts to social events or to work is a no-no. A good polo in a simple, dark color is always presentable and always flattering if its fitted well. You can also opt for buttoned short-sleeved shirts in the summer. ',5,'8.jpg','image/jpeg',42425,'2015-10-31 12:01:20','','2015-10-31 12:01:21','2015-12-18 08:59:33','fe41e54e-ae2d-11e5-82d8-f23c916e290f'),(13,'Shoes ','','A traditional school of thought thats still alive and well claims you can judge a man by his shoes. Quality leather footwear isnt a luxury for the excessively rich  its a necessity for any man.',24,'68653-162910.jpg','image/jpeg',59768,'2015-10-31 12:12:31','','2015-10-31 12:12:33','2015-12-18 08:58:21','fe41e62a-ae2d-11e5-82d8-f23c916e290f'),(14,'Style tips for short men','','Dress shirts that increase the perception of height ideally have vertical striping that is narrow enough to be visible at a glance. ',21,'1.jpg','image/jpeg',674495,'2015-10-31 14:24:44','','2015-10-31 14:24:46','2015-12-18 08:27:42','fe41e6fc-ae2d-11e5-82d8-f23c916e290f'),(15,'Button Up the Suit Jacket ','','There are three ways to fasten your suit jacket. Never button up the last one in the bottom. And always unbutton when you sit.',12,'suits-blooper.jpg','image/jpeg',272196,'2015-11-17 13:47:01','','2015-11-17 13:47:03','2015-11-17 13:47:03','fe41e7e2-ae2d-11e5-82d8-f23c916e290f'),(16,'Tuck your Shirt','','Even when casual, keep it smart. Tuck in your shirt and buy the right T-shirt length. Throw on a belt and slip into loafers for added style points.',12,'21.jpg','image/jpeg',118720,'2015-11-18 06:03:47','','2015-11-18 06:03:49','2015-11-18 06:03:49','fe41e8be-ae2d-11e5-82d8-f23c916e290f'),(17,'Necklace: More-is-More','','Coco Chanel\'s more-is-more approach still makes a statement. You can do multiples of the same material or go for contrast: Try a femme piece with edgy chains, beads or pearls with diamants.',13,'image.jpg','image/jpeg',94032,'2015-12-18 08:05:42','','2015-12-18 08:05:43','2015-12-18 08:15:09','fe41e99a-ae2d-11e5-82d8-f23c916e290f'),(19,'Choosing Necklaces For Necklines','','Pairing your jewelry with your neckline certainly makes a difference! Your necklace choice should compliment your outfit; the neckline of your shirt or dress being the most important thing to consider',13,'swatch-image20140320-26837-5lftxc.jpg','image/jpeg',66012,'2016-01-17 08:43:56','','2016-01-17 08:43:57','2016-01-17 08:43:57','6ccb915b-3130-4a85-b4c1-edef4ace72f6'),(20,'Tucking Jeans Into Boots','','No more fat ankles!! Most of the jeans are boot cut or straight leg. This poses a problem when it comes to wearing boots  not only does it make it hard to zip them up, but you\'re sometimes left with bunched up fabric that is uncomfortable and unflattering! If you have a similar problem, here is a nice little trick to tucking those non-skinny jeans into your boots.',13,'No-more-fat-looking-ankles-31-Clothing-Tips-Every-Girl-Should-Know.jpg','image/jpeg',147727,'2016-01-17 08:55:27','','2016-01-17 08:55:28','2016-01-17 08:55:28','c58b2961-607b-4335-9151-eb9c700887e6'),(21,'Trick For Cuffed Sleeves','','Fold, roll, tug and scrunch. Thats if you want the J. Crew look  you know, effortless looking but awesome. Although you wouldnt button up my shirt all the way to the neck and wear a denim shirt with jeans.',13,'23427501.jpg','image/jpeg',43318,'2016-01-17 10:04:03','','2016-01-17 10:04:04','2016-01-17 10:04:04','71704788-d574-4a70-8578-7c759b11a77f'),(22,'Dresses','','Looking truly sexy involves knowing what to bare-and what to keep under wraps. Otherwise, where\'s the mystery? \"Choose one-only one-body part and show it off,\" advises Jen Rade, stylist to Jenna Fischer and Angelina Jolie. \"If it\'s cleavage, don\'t show your legs. If it\'s your legs, stay covered on top.\"\r\n',13,'models-in-dresses-15-koktely-short-dresses-2014-trend2-mrE.png','image/png',108138,'2016-01-17 10:21:34','','2016-01-17 10:21:35','2016-01-17 10:21:35','edb9f7fa-8e2b-43ad-beed-13d76b1ab3cd'),(23,'Go Hands Free With Chain Slings','','A dressy bag with a chain helps you hold crudits and a cocktail-plus, it lends a cool edge to evening wear, says stylist Cher Coulter. Wear the chain diagonally across your body for the best effect.\r\n',13,'91U99qqGaiL._UL1500_.jpg','image/jpeg',374022,'2016-01-17 10:49:46','','2016-01-17 10:49:48','2016-01-17 10:49:48','b85f05e8-f139-400a-a4cd-f5d3e30d7faf'),(24,'WHEN IN DOUBT, WEAR NUDE PUMPS','','Matched to your skin tone, they\'re a pretty safe bet. (And they make legs look longer.)\r\n',13,'NMX2R3C_mu.jpg','image/jpeg',19363,'2016-01-17 11:19:02','','2016-01-17 11:19:03','2016-01-17 11:19:03','ebc712cb-b79a-489a-b315-2b2eab36d62c'),(25,'STRIPE IT UP','','\"Striped pieces are a nice, classic way to pull yourself together for the weekend,\" says stylist Tina Chai. A red- or navy-and-white bateau neck, for instance, has presence and versatility.\r\n',12,'img-thing.jpg','image/jpeg',22742,'2016-01-17 11:28:55','','2016-01-17 11:28:56','2016-01-17 11:28:56','b55f6f84-4093-4621-9016-705453b604ba'),(26,'NEVER BUY A BORING COAT','','\"Outerwear should never be an afterthought,\" says Holmes amp Yang co-designer Jeanne Yang. \"So many people only see you in your coatif you\'re not wearing something great underneath your trench, they\'ll never even know!\" Look for a stylish coat, like Twiggy\'s here.\r\n',13,'0824-24-twiggy-400_1.jpg','image/jpeg',43066,'2016-01-17 11:33:03','','2016-01-17 11:33:04','2016-01-17 11:33:04','8fc85951-f9ee-4038-a295-50317e329440'),(27,'GO BEYOND THE BLAZER','','You should already have your go-to tailored jacket. But a wardrobe of less formal toppers will help you look pulled together even on casual days. Opt for a leather jacket with wool trousers, a jean version over a silk shirt, or-stylists\' favorite!-an army jacket over just about anything.',12,'0706407800_2_3_1.jpg','image/jpeg',28161,'2016-01-17 11:51:19','','2016-01-17 11:51:20','2016-01-17 11:51:20','0c395973-eb3b-41cd-be17-9d9cd6d9ff8d');
